import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a product card to open product details
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card');

    // Wait for product modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Click the "Add to Wish List" button
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });
    await page.click('.add-to-wishlist');

    // Wait for success notification
    await page.waitForSelector('.notification.success', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_added.png'));

    // Extract product details that were added to wishlist
    const productTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-detail-price', el => el.textContent.trim());

    return {
      success: true,
      action: "Added product to wishlist successfully",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
